/*
 * 	startup.c
 *
 */

#define SIMULATOR

#define STK             0xE000E010
#define STK_CTRL        ((volatile unsigned int *  )  (STK))
#define STK_LOAD        ((volatile unsigned int *  )  (STK+0x4))
#define STK_VAL         ((volatile unsigned int *  )  (STK+0x8))
#define STK_CALIB       ((volatile unsigned int *  )  (STK+0xC))

__attribute__((naked)) __attribute__((section (".start_section")) )
void startup ( void )
{
__asm__ volatile(" LDR R0,=0x2001C000\n");		/* set stack */
__asm__ volatile(" MOV SP,R0\n");
__asm__ volatile(" BL main\n");					/* call main */
__asm__ volatile(".L1: B .L1\n");				/* never return */
}

__attribute__((naked))
void graphic_initalize(void){
    __asm volatile (" .HWORD  0xDFF0\n");
    __asm volatile (" BX LR\n");
}

__attribute__((naked))
void graphic_clear_screen(void){
    __asm volatile (" .HWORD  0xDFF1\n");
    __asm volatile (" BX LR\n");
}

__attribute__((naked))
void graphic_line_set(int x, int y, int i)
{
    __asm__ volatile (" Z0: .HWORD 0xDFF2\n"); // Rita ut pixel p√• position x, y
    __asm__ volatile (" Z1: ADD R0,#1\n");    // x += 1
    __asm__ volatile (" LSL R2,R2,#1\n");      // i = i << 1
    __asm__ volatile (" BCS Z0\n"); // Hoppa till Z0 om c = 1
    __asm__ volatile (" CMN R2,R2\n");
    __asm__ volatile (" BNE Z1\n"); // Hoppa till Z1 om R2 != 0
    __asm__ volatile (" BX LR\n");
}

void delay_250ns(void)
{
    *STK_CTRL = 0;
    *STK_LOAD = 168/4-1;
    *STK_VAL = 0;
    *STK_CTRL = 5;
    while ((*STK_CTRL & 0x10000) == 0);
}

void delay_micro(unsigned int us){
    #ifdef SIMULATOR
        us = us/1000;
        us++;
    #endif
    
    while (us > 0){
        delay_250ns();
        delay_250ns();
        delay_250ns();
        delay_250ns();
        us--;
    }
}

void delay_milli(unsigned int ms){
    delay_micro(ms*1000);
}

